import React from 'react';

function Signup({ onLoginClick, onSignupSubmit }) {
  return (
    <div className="signup">
      <h2>Signup Page</h2>
      <form onSubmit={(e) => { e.preventDefault(); onSignupSubmit(); }}>
        <input type="text" placeholder="Username" required />
        <input type="password" placeholder="Password" required />
        <button type="submit">Sign Up</button>
      </form>
      <p>
        Already have an account? <span onClick={onLoginClick} style={{ color: 'blue', cursor: 'pointer' }}>Login</span>
      </p>
    </div>
  );
}

export default Signup;
